import { Col, Container, Row } from 'react-bootstrap';

function ProfilePage() {
  return (
    <Container
      fluid
      style={{
        backgroundImage:
          'url(https://images.pexels.com/photos/1379636/pexels-photo-1379636.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1)',
        backgroundSize: 'cover',
        minHeight: '100vh',
      }}
    >
      <Row style={{ minHeight: '100vh' }} className="w-100  d-flex justify-content-center align-items-center">
        <Col md={4} style={{ backgroundColor: '#fff' }}>
          1
        </Col>
      </Row>
    </Container>
  );
}

export default ProfilePage;
